"""# 4.Data Preparation
Melakukan pembagian dataset pada kedua dataset tersebut menjadi dua bagian yaitu, Data Pelatihan dan Data Pengujian. Proporsi data pelatihan adalah 80% dan pengujian adalah 20%
"""

X = df.drop('target', axis=1)
X = X.values

y = df['target']
y = y.values

from sklearn.model_selection import train_test_split

X_train, X_test, y_train, y_test = train_test_split(X,y ,
                                                   test_size = 0.2,
                                                   random_state = 20)

"""# Explore The Best

### Akurasi Model Menggunakan Neural Network
"""

# 1. Neural Network
from sklearn.neural_network import MLPClassifier

##nn = MLPClassifier(max_iter = 5000, random_state = 2)
nn = MLPClassifier(random_state = 2)
nn.fit(X_train, y_train)

# Model Evaluation
from sklearn.metrics import accuracy_score, precision_score, recall_score, f1_score
y_predn = nn.predict(X_test)
accuracy =  accuracy_score(y_predn, y_test)

print("Accuracy Neural Network = "+ str(accuracy.round(2)))

from sklearn.metrics import confusion_matrix, classification_report

cf_matrix = confusion_matrix(y_test, y_predn, labels=[1, 0])
cf_matrix

sns.heatmap(cf_matrix, annot=True)

"""Penjelasan: Terdapat Nilai True Positif = 91, False Negatif = 15, False Positif = 24, True Negatif = 75.

"""

